import React from "react";
import Social from './Social.jpg';

function Footer() {
    return (
        <div id="footer">
            <img src={Social} alt="social" />
            Adeola Ogundipe            
            <a href="https://www.linkedin.com/in/racheal-ogundipe/"> Linkedin </a>
        </div>
    );
}

export default Footer;
